import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Link
} from "react-router-dom";
import PagesPromotionSearch from './Promotion/Search/Search';

const Root = () => {
  return (
    <Router>
        <Route path="/" component={PagesPromotionSearch} />
    </Router>
  )
}

export default Root;
